App.Animal = DS.Model.extend({
    name: DS.attr('string'),
    age: DS.attr('integer'),
    species: DS.attr('string'),
    breed: DS.attr('string'),
    drugs: DS.attr('string'),
    cTime: DS.attr('date'),
    sex: DS.attr('string'),
    sterilized: DS.attr('boolean'),
    foto: DS.attr('string'),

    recordDate: function () {
        return moment(this.get("cTime")).format('MMMM Do YYYY, h:mm:ss a');
    }.property("content.cTime"),

});

